import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';

import { Container, ListGroup, Card } from "react-bootstrap";

function IngenieriaAmbiental() {
     return (
          <>
          <Container className="my-5">
               <Card>
               <Card.Body>
                    {/* Título principal */}
                    <h1 className="text-center mb-4">INGENIERÍA AMBIENTAL</h1>

                    {/* Lista de servicios */}
                    <ListGroup variant="flush" className="mb-3">
                    <ListGroup.Item className="fw-bold">Ingeniería Ambiental</ListGroup.Item>
                    <ListGroup.Item>Manifestación de impacto ambiental</ListGroup.Item>
                    <ListGroup.Item>Informe preventivo</ListGroup.Item>
                    <ListGroup.Item>Estudios de riesgo</ListGroup.Item>
                    <ListGroup.Item>Programa de prevención de accidentes</ListGroup.Item>
                    <ListGroup.Item>Cédula de operación anual</ListGroup.Item>
                    <ListGroup.Item>Estudios de emisiones a la atmósfera</ListGroup.Item>
                    <ListGroup.Item>Análisis de aguas residuales</ListGroup.Item>
                    <ListGroup.Item>CRETI</ListGroup.Item>
                    <ListGroup.Item>Suelos contaminados</ListGroup.Item>
                    <ListGroup.Item>Estudios de ambiente laboral</ListGroup.Item>
                    </ListGroup>
               </Card.Body>
               </Card>
          </Container>
          </>
     );
}
export default IngenieriaAmbiental;
